import { BrowserRouter , Routes , Route } from "react-router-dom";
import Main from "./pages/main";
import Balanced from "./pages/balanced";
import Age from "./pages/age"  

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route index element={<Main/>} path="/"/>
        <Route  element={<Main/>} path="/home"/>
        <Route  element={<Balanced/>} path="/balanced"/>
        <Route index element={<Age/>} path="/age"/> 
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
